import "./App.css";
import Input from "./components/input";
import LeftPanel from "./components/left-panel";
import Operators from "./components/operators";

function App() {
  return (
    <div className="calculator">
      <Input />
      <div className="buttons">
        <Operators />
        <LeftPanel />
        <div className="equal">=</div>
      </div>
    </div>
  );
}

export default App;
